    /* Отправка форм */
    function formSubmit(validate) {
      if (flsModules.popup) {
        flsModules.popup.open("some");
      }
      const forms = document.forms;
      if (forms.length) {
        for (const form of forms) {
          form.addEventListener("submit", function (e) {
            const form = e.target;
            formSubmitAction(form, e);
          });
          form.addEventListener("reset", function (e) {
            const form = e.target;
            formValidate.formClean(form);
          });
        }
      }
      async function formSubmitAction(form, e) {
        const error = validate ? formValidate.getErrors(form) : 0;
        if (error === 0) {
          const ajax = form.hasAttribute("data-ajax");
          if (ajax) {
            // Если режим ajax
            e.preventDefault();
            const formAction = form.getAttribute("action")
              ? form.getAttribute("action").trim()
              : "#";
            const formMethod = form.getAttribute("method")
              ? form.getAttribute("method").trim()
              : "GET";
            const formData = new FormData(form);
            let response;
            form.classList.add("_sending");
            if (formMethod === "GET") {
              response = await fetch(formAction, {
                method: formMethod,
              });
            } else {
              response = await fetch(formAction, {
                method: formMethod,
                body: formData,
              });
            }

            if (response.ok) {
              let responseResult = await response.json();
              form.classList.remove("_sending");
              formSent(form);
            } else {
              alert("Ошибка");
              form.classList.remove("_sending");
            }
          } else if (form.hasAttribute("data-dev")) {
            // Если режим разработки
            e.preventDefault();
            formSent(form);
          }
        } else {
          e.preventDefault();
          const formError = form.querySelector("._form-error");
          if (formError && form.hasAttribute("data-goto-error")) {
            gotoblock_gotoBlock(formError, true, 1000);
          }
        }
      }
      // Действия после отправки формы
      function formSent(form) {
        // Создаем событие отправки формы
        document.dispatchEvent(
          new CustomEvent("formSent", {
            detail: {
              form: form,
            },
          })
        );
        // Показываем попап, если подключен модуль попапов
        // и для формы указана настройка
        setTimeout(() => {
          if (flsModules.popup) {
            const popup = form.dataset.popupMessage;
            popup ? flsModules.popup.open(popup) : null;
          }
        }, 0);
        // Очищаем форму
        formValidate.formClean(form);
        // Сообщаем в консоль
        formLogging(`Форма отправлена!`);
      }
      function formLogging(message) {
        FLS(`[Формы]: ${message}`);
      }
    }
